  - name: TEXT4000
    number: '6'
    value: 'This memo text is in response to the 3 items questioned in your letter
      dated 2/11/09.  ITEM 1: The aggregate y-t-d totals you questioned actually refer
      to the donor''s contributions to CFG PAC, not to the candidate or committee
      referenced in the memo entry. As we have discussed previously, the FECfile software
      does not allow us to edit this field and all the data was imported in the format
      shown on the instructions for the FECfile software. ITEM 2. The difference between
      the FEC calculations and that with this Monthly Report is explained by the $2,545.34
      transaction reported on Line 24 on 8/11/08 as an Independent Expenditure in
      support of Bob Schaffer (CO-Senate-00).  The transaction, which now has been
      corrected, was mislabled as House-CO-00.  This brings the calendar year to date
      total for the CO Primary to $8,618.77.  The total you listed in your letter
      refers to a YTD of $8,297.97; however, we believe you were not including a $320.80
      transaction also made on 8/11/08 in support of Bob Schaffer in your figure.  ITEM
      3: This appears to be a duplicate entry and has been deleted.  Reports that
      were affected by removing this transaction will be amended to reflect the changes.

